import "../style.css";
import Nav from "../components/nav"
const Home=()=>{
    return(
        <section className="section1">
            <div className="Header">
                <img src="image/img1.png" alt="prew"/>
                <a id="link1" href="#">Zeta</a>
                <p id="txt1">Welcome to Future</p>
                <button id="btn1">Wallet</button>
            </div>
            <Nav/>
        </section>
    )
}
export default Home;
